import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <section className="section-login">
        <h1>Login Page</h1>
        <form action="post">
          <input type="text" name="username"/>
          <input type="text" name= "password"/>
          <input type="submit" valur="Submit"/>
        </form>
      </section>
    );

}
}

export default Login;
